import React, { Component } from 'react'


import { Layout, Menu } from 'antd';
import { UserOutlined, LaptopOutlined, NotificationOutlined } from '@ant-design/icons';

const { SubMenu } = Menu;
const { Sider } = Layout;

export default class SideMenu extends Component {
    render() {
        return (
            <Sider width={200} className="site-layout-background" >
                <Menu
                    theme="dark"
                    mode="inline"
                    defaultSelectedKeys={['1']}
                    defaultOpenKeys={['sub1']}
                    style={{ height: '100%', borderRight: 0 }}>
                    <SubMenu key="sub1" icon={<UserOutlined />} title="社团管理">
                        <Menu.Item key="1">社团列表</Menu.Item>
                        <Menu.Item key="2">创建社团</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub2" icon={<LaptopOutlined />} title="审核管理">
                        <Menu.Item key="5">审核纳新</Menu.Item>
                        <Menu.Item key="6">审核退社</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub3" icon={<NotificationOutlined />} title="杂项管理">
                        <Menu.Item key="9">呼呼呼</Menu.Item>
                        <Menu.Item key="10">啦啦啦</Menu.Item>
                        <Menu.Item key="11">哈哈哈</Menu.Item>
                        <Menu.Item key="12">嘻嘻嘻</Menu.Item>
                    </SubMenu>
                </Menu>
            </Sider>
        )
    }
}
